description:
Battle Zones: Ukraine and Syria

War Documentary hosted by Will Lyman, published by PBS broadcasted as part of PBS Frontline series in 2014 - English narration


Information
------------------------------

Battle for Ukraine: The unrest in Ukraine in early 2014 has provoked one of the biggest confrontations between Russia and the U.S. since the Cold War. FRONTLINE's James Jones delivers a chilling look at both sides of the ongoing fight. 
Arming the Rebels: Reporter Muhammad Ali crosses into the war zone, and finds Syrian rebel fighters who say they're being secretly armed and trained by the U.S. out of Qatar.

